import React from 'react';
import Pizza from '../components/Pizza';
import pizzas from '../pizzasdata';

export default function HomeScreen() {
    return (
        <div>
            <div>

                {pizzas.map(pizza => {

                    return <div className="cal-md-4">
                        <div>
                            <Pizza pizza={pizza} />
                        </div>
                    </div>

                })}

            </div>
        </div>
    )
}
